import React, { Component } from 'react'
import {FaGithub,FaInstagram,FaLinkedin} from "react-icons/fa"
import "./Content.css"

class Content extends Component {

boxImg(){
    return <img src='https://dama.ink/static/media/profile.c3700b103e136d4c37b41eb261ee9743.svg' alt='img1'/>
}

boxDisc(){
    return<div className='disc'>
    <code>Hi,I'm</code>
    <h2>{this.props.data.name}</h2>
    <h5>{this.props.data.job}</h5>
    <p>{this.props.data.disc}</p>
    <FaGithub style={{width:"30px",fontSize:"20px"}}/>
    <FaInstagram style={{width:"30px",fontSize:"20px"}}/>
    <FaLinkedin style={{width:"30px",fontSize:"20px"}}/>
    </div>
}
main_page(){
    return<>
    {this.boxImg()}
    {this.boxDisc()}
    </>
}

  render() {
    return (
      <>
      <div className='page2'>
        {this.main_page()}
      </div>
      <center><img src='https://dama.ink/static/media/curve-hr.16b9fca607ca7942b81f2887bc2dae79.svg' style={{width:"0px"}}/></center>
      </>
    )
  }
}

export default Content





























